import React from "react";
import {auth} from "../firebase";




const LogOut = () => {
    const signOut = () => {
        signOut(auth)
    }

    return (
        <div className="bg-black text-white" onClick={() => auth.signOut()}>LogOut</div>
    )
}

export default LogOut
